import s from './Info.module.css';

const Info = () => {
    return (
        <div className={s.info}>
            <div className={s.photo}>
                <img src='/img/freddie2.jpeg'/>
            </div>

            <div className={s.photoInfo}>
                <h3>Freddie Mercury</h3>

                <div><p className={s.key}>Born:</p> <p className={s.description}>2 September 1946</p></div>
                {/*<p>*/}
                {/*    <span>Born:</span> 2 September 1946<br/>*/}
                {/*    <span>Nationality:</span> British<br/>*/}
                {/*    <span>City:</span> London<br/>*/}
                {/*    <span>Occupation:</span> singer, songwriter, record producer and lead vocalist of the rock band Queen*/}
                {/*</p>*/}
            </div>
        </div>
    )
}

export default Info;
